  'visualeditor-descriptionpagelink' => 'Project:കണ്ടുതിരുത്തൽ സൗകര്യം',
  'visualeditor-dialog-beta-welcome-action-continue' => 'തുടരുക',
  'visualeditor-dialog-beta-welcome-content' => 'ഇതാണ് നമ്മുടെ പുതിയ എളുപ്പത്തിലുള്ള തിരുത്താനുള്ള മാർഗ്ഗം. ഇതിപ്പോഴും പരീക്ഷണ ഘട്ടത്തിലാണ് (ബീറ്റാ), അതിനർത്ഥം താളിൽ ഇതുപയോഗിച്ച് തിരുത്താനാവാത്ത ഭാഗങ്ങൾ താങ്കൾ നേരിടേണ്ടി വന്നേക്കാം, അല്ലെങ്കിൽ ശരിയാക്കേണ്ട മറ്റ് പ്രശ്നങ്ങളെ നേരിട്ടേക്കാം എന്നാണ്. പ്രശ്നങ്ങൾ ഒഴിവാക്കാൻ താങ്കൾ ചെയ്യുന്ന മാറ്റങ്ങൾ താങ്കൾ തന്നെ സംശോധനം ചെയ്യണമെന്നും ഒപ്പം കണ്ടുതിരുത്തൽ സൗകര്യത്തിൽ താങ്കൾ നേരിടുന്ന എന്ത് പ്രശ്നവും ഞങ്ങളെ അറിയിക്കാനും താത്പര്യപ്പെടുന്നു  (പ്രതികരണങ്ങൾ അറിയിക്കാൻ \'{{int:visualeditor-help-tool}}\' എന്ന ബട്ടൺ അമർത്തുക).  താങ്കൾ വരുത്തിയ മാറ്റങ്ങളൊന്നും നഷ്ടപ്പെടാതെ വിക്കി എഴുത്തുകൾ ഉപയോഗിച്ചുള്ള തിരുത്തലുകൾ നടത്താൻ "$1" എന്ന റ്റാബ് എപ്പോൾ വേണമെങ്കിലും ഉപയോഗിക്കാവുന്നതാണ്.',
  'visualeditor-dialog-beta-welcome-title' => 'കണ്ടുതിരുത്തൽ സൗകര്യത്തിലേയ്ക്ക് {{GENDER:$1|സ്വാഗതം}}',
  'visualeditor-dialog-media-alttext-section' => 'പകരമുള്ള എഴുത്ത്',
  'visualeditor-dialog-media-alttext-section-help' => 'ഇനം കാണാനാവാത്തവർക്ക് ഒരു വിവരണ എഴുത്ത് നൽകാൻ താങ്കൾക്കിത് ഉപയോഗിക്കാവുന്നതാണ്. വിവരണം, മീഡിയ ഇനത്തിന്റെ ഉള്ളടക്കവും ലക്ഷ്യവും മനസ്സിലാക്കാൻ പ്രാപ്തമായിരിക്കണം. സ്ക്രീൻ-റീഡർ സോഫ്റ്റ്‌വേറോ, എഴുത്ത്-മാത്രമുള്ള ബ്രൗസറുകളൊ ഉപയോഗിക്കുന്ന അന്ധ ഉപയോക്താക്കൾക്കും മറ്റുള്ളവർക്കുമൊക്കെ ഇത് സുപ്രധാനമാണ്.',
